def solve():
    s = "S -> NT17 NT59"
    grammar = s[0:10]
    string = "t1 t2 t1 t5 t5 t3 t9"

    # Create a dictionary of the grammar for easy lookup.
    grammar_dict = {}
    for char in grammar:
        if char.isalnum():
            grammar_dict[char] = 1

    def is_valid(string, grammar_dict):
        stack = []
        for char in string:
            if char in grammar_dict:
                stack.append(char)
            elif char in grammar_dict.values():
                if not stack:
                    return False
                top = stack.pop()
                if grammar_dict[top] != char:
                    return False
            else:
                return False
        return not stack

    if is_valid(string, grammar_dict):
        print("Yes")
    else:
        print("No")

